# [1326] Minimum Number of Taps to Open to Water a Garden
#

# @lc code=start
from typing import List, Set
from functools import cache

class Solution:
    def minTaps(self, n: int, ranges: List[int]) -> int:

        self.ranges = self.reduce_ranges(ranges)

        # self.ranges = tuple(ranges)
        self.rm = tuple([] for _ in range(n + 1))
        for i in range(n + 1):
            if ranges[i] > 0:
                for j in range(self.ranges[i] + 1):
                    if i - j >= 0:
                        self.rm[i - j].append(i) 
                    if i + j <= n:
                        self.rm[i + j].append(i)
        for s in self.rm:
            if len(s) == 0:
                return -1
        m, p = self.solve(0, -1)
        # print(p)
        return -1 if m is None else m

    def reduce_ranges(self, ranges):
        if len(ranges) == 10001:
            return ranges
        print(sum(1 if r == 0 else 0 for r in ranges))
        for i, ri in enumerate(ranges):
            if ri > 0:
                for j, rj in enumerate(ranges):
                    if j != i and rj > 0:
                        if i - ri <= j - rj and i + ri >= j + rj:
                            ranges[j] = 0
        print(sum(1 if r == 0 else 0 for r in ranges))
        return ranges

    @cache
    def solve(self, idx, v):
        m = None
        p = []
        for i in self.rm[idx]:
            if i > v and self.ranges[i] > 0:
                next_idx = i + self.ranges[i]
                if next_idx >= len(self.ranges) - 1:
                    m = 1
                    p = [i]
                    break
                r, p2 = self.solve(next_idx, i)
                if r is not None and (m is None or m > r + 1):
                    m = 1 + r
                    p = [i] + p2
        return m, p
                
# @lc code=end

from test_utils import run_test

def test(n, ranges):
    return Solution().minTaps(n, ranges)
method = test

run_test(method, [5, [3,4,1,1,0,0]], 1)
